import * as api from "../helpers/Api";
import store from "../index";
// action Creators
export const getEmployees = () => async (dispatch) => {
  try {
    console.log(store.getState().token , " TOKEN STORe")
    const data = await api.fetchEmployees(
      "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxNTJiNmU1OTExZjZiYzY3MmQzZDZmNSIsImlhdCI6MTYzMzQ0MjkwOCwiZXhwIjoxNjM2MDM0OTA4fQ.XnTeqJVCyo3LsGMHiS9fq0M3pAgzEKAukwW4ZCKMmf0"
    );
    dispatch({ type: "FETCH_ALL", payload: data });
  } catch (err) {
    console.log(err);
  }
};
